import React from "react";
import DHIlab from "./DHIlab/DHIlab";
import './Navbar.css';  // Importing the CSS file

const Navbar = () => {
  let isArrayFunction = (inputArray) => {
    if (Array.isArray(inputArray) && inputArray.length !== 0) {
      return false;
    } else {
      return true;
    }
  };

  return (
    <div id="Navbar">
      <div className="usa-overlay"></div>
      <header className="usa-header usa-header--basic usa-header--megamenu padding-bottom-4 padding-top-6">
        <div className="usa-nav-container">
          <div className="usa-navbar">
            <div className="usa-logo margin-0" id="basic-mega-logo">
              <em className="usa-logo__text">
                <div className="display-flex flex-row align-items-center">
                  <DHIlab />
                  <h3 className="display-inline-block padding-left-1">
                    Symptom Checker
                  </h3>
                </div>
              </em>
            </div>
            <h4>(Experiment Version)</h4>
            <div>
              <form className="text-size-form">
                <label htmlFor="fontSizeRange">Text Size:</label>
                <input
                  type="range"
                  id="fontSizeRange"
                  min="10"
                  max="30"
                  defaultValue="16"
                  onInput={(e) => updateTextSize(e.target.value)}
                />
              </form>
            </div>
          </div>
        </div>
      </header>
    </div>
  );
};

const updateTextSize = (size) => {
  document.documentElement.style.setProperty("--base-font-size", size + "px");
};

export default Navbar;
